import '../Components/Root/Root.css'
import '../Components/Root/Reset.css'




import Pdv from "./Pdv"

import { BrowserRouter, Routes, Route ,Link } from 'react-router-dom'



export default function App() {
  return (
    <>


    <Header />
      <Apresentacao />
      <Footer />
    </>
  );
}

function Rota(){
  return (
    <BrowserRouter>
    <Routes>

      <Route  path="/" element={<App />} ></Route>
      <Route  path="/pdv" element={<Pdv />} ></Route>

    </Routes>
  </BrowserRouter>
  )
}
